import {Routes, Route} from 'react-router-dom'; 

import Home from "./components/routes/home/home.component";

const App = () => {
  return (    
    <Routes>
      <Route path='/home' element={<Home />}> 
      <Route index element={<Home/>}/>
      <Route />
      </Route>   
    </Routes>
  );
};

export default App;
